  [],\n\t\"revision_timestamp\": \"2016-05-25T00:52:28.144260\",\n\t\"name\": \"automated-weather-observing-system-surface-observing-system-data-acquisition-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Automated Weather Observing System (AWOS)/Automated
  Surface Observing System (ASOS) Data Acquisition System (ADAS) collects, analyzes,
  and redistributes weather information to support the National Airspace System (NAS).
  \ The ADAS receives minute-by-minute AWOS (also ASOS, non-Federal AWOS and U.S.
  Department of Defense (DoD) automated observation system) weather messages.  ADAS
  distributes surface observation weather messages to the Weather and Radar Processing
  (WARP) system and the Weather Message Switching Center Replacement (WMSCR) system.
  \ The ADAS also receives cloud-to-ground lightning strike information from a vendor
  that maintains a national network of sensors and distributes this information via
  an ADAS subsystem called ALDARS (Automated Lightning Detection and Reporting System)
  to the appropriate ASOS/AWOS site.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
